import React from 'react';
import './Projects.css';


function Projects(props) {
    return (
        <div className='project-page-container'>

            <div className="card">

                <div className="card-header">
                    <div className="card-img-wrapper">
                        <img src={require('../../')} alt="" />
                    </div>
                </div>


              </div>

        </div>
    );
}

export default Projects;
